import React from 'react';
import { SipProvider } from 'react-sip';

const SIP_USERNAME = '200-dataocean';
const SIP_PASSWORD = 'RjH2TV2s9s8FHSpz';
const SIP_DOMAIN = 'webrtc.1com.co.il';
const SIP_SERVER = `wss://${SIP_DOMAIN}/ws`;

const Phone = () => {

    return (
        <SipProvider
            host={SIP_DOMAIN}
            // port={7443}
            pathname="/ws" // Path in socket URI (e.g. wss://sip.example.com:7443/ws); "" by default
            user={SIP_USERNAME}
            password={SIP_PASSWORD} // usually required (e.g. from ENV or props)
            autoRegister={true} // true by default, see jssip.UA option register
            autoAnswer={false} // automatically answer incoming calls; false by default
            iceRestart={false} // force ICE session to restart on every WebRTC call; false by default
            sessionTimersExpires={120} // value for Session-Expires header; 120 by default
            debug={false} // whether to output events to console; false by default
        >
            <div>
                <button>call</button>
            </div>
        </SipProvider>
    );
};

export default Phone;
